      var dismissibleItem = function(el, type, id, message, url, linkText, expiry) {

  var hasExpiry = (id && expiry) ? true : false,
      html = '<div class="dismissible-alert--information"><button class="close" data-dismiss="alert" aria-label="close">&times;</button><div class="row"><div class="col-md-1 offset-1 pl-0 d-none d-lg-flex justify-content-end align-items-center"><div class="d-flex justify-content-center align-items-center info-alert-icon"></div></div><div class="col-lg-9 d-flex justify-content-center flex-column"><p><strong>' + message + ' <a href="' + url +'">'+ linkText + '</a>' + '.' + '</strong></p></div>';
      
    if (hasExpiry && storageEnabled) {
      var timestamp = window.Storage.get(id);
      if (timestamp) {
        if (expiry === 'forever') {
          el.remove();
          return;
        } else {
          var now = new Date(),
            diffInHours = Math.floor((now.getTime() - parseInt(timestamp)) / (1000 * 60 * 60));
          if (diffInHours >= expiry) {
            window.Storage.delete(id);
          } else {
            el.remove();
            return;
          }
        }
      }
    }
      
  el.classList.add('dismissible', 'dismissible-' + type);

  el.removeAttribute('data-component');
  el.removeAttribute('data-expiry');
  el.removeAttribute('data-id');
  el.removeAttribute('data-type');
  el.removeAttribute('data-message');
  el.removeAttribute('data-url');
  el.removeAttribute('data-link-text');
      

  el.innerHTML = html;

  function dismissBanner(event) {
    var height = el.offsetHeight,
      opacity = 1,
              timeout = null;
          
          if (hasExpiry && storageEnabled) {
              window.Storage.set(id, new Date().getTime());
          }
              
    function reduceHeight() {
      height -= 2;
      el.setAttribute('style', 'height: ' + height + 'px; opacity: ' + opacity);
      if (height <= 0) {
        window.clearInterval(timeout)	;
        timeout = null;
        el.remove();
      }
    }
    function fade() {
      opacity -= .1;
      el.setAttribute('style', 'opacity: ' + opacity);
      if (opacity <= 0) {
        window.clearInterval(timeout);
        timeout = window.setInterval(reduceHeight, 1);
      }
    }
    timeout = window.setInterval(fade, 25);
  }

  el.querySelector('.close').addEventListener('click', dismissBanner);

};

var dismissibles = Array.prototype.slice.call(document.querySelectorAll('[data-component="dismissible-item"]'));
if (dismissibles.length) {
  for (var i = 0; i < dismissibles.length; i++) {
    var expiry = dismissibles[i].getAttribute('data-expiry'),
        id = dismissibles[i].getAttribute('data-id'),
      type = dismissibles[i].getAttribute('data-type'),
              message = dismissibles[i].getAttribute('data-message'),
              url = dismissibles[i].getAttribute('data-url'),
              linkText = dismissibles[i].getAttribute('data-link-text');
    new dismissibleItem(dismissibles[i], type, id, message, url, linkText, expiry);
  }
}

